import UseRefComp from './Components/UseRefComp';
import UserReducerComp from './Components/UserReducerComp';

function App() {
  return (
    <div >
      <UseMemoDemo/>
      <hr></hr>
      <UserReducerComp/>
      <hr></hr>
       <EmailComponent/>
       <hr></hr>
       <DisplayProducts/>
       <hr></hr>
       <PersonDetails/>
       <hr height="5px"></hr>
       <UseRefComp/>
    </div>
  );
}

export default App;
